<div class="header"><?php include("header.php"); ?></div><h1>NeuLab-TedTalks v1</h1>This dataset is compiled from TED talk subtitles and distributed through <a href="http://phontron.com/data/ted_talks.tar.gz">phontron.com</a>. The package here includes the training data only (development and test data are not included in this package). The transcripts have been <a href="https://www.ted.com/participate/translate">translated by a global community of volunteers</a> to more than 100 languages. The parallel corpus and the code fopr cerating it is available from <a href="https://github.com/UKPLab/sentence-transformers/blob/master/docs/datasets/TED2020.md">https://www.ted.com/participate/translate</a><p>59 languages, 1,711 bitexts<br>total number of files: 59,949<br>total number of tokens: 108.23M<br>total number of sentence fragments: 6.45M<br><p>Please <a href="http://opus.lingfil.uu.se/LREC2012.txt">cite the following article</a> if you use the OPUS packages and downloads in your own work:<br/> J. Tiedemann, 2012, <a href="http://www.lrec-conf.org/proceedings/lrec2012/pdf/463_Paper.pdf"><i>Parallel Data, Tools and Interfaces in OPUS.</i></a> In Proceedings of the 8th International Conference on Language Resources and Evaluation (LREC 2012)<br/><h3>Download</h3><p>Below you can download data files for all language pairs in different formats and with different kind of annotation (if available). You can click on the various links as explained below. In addition to the files shown on this webpage, OPUS also provides pre-compiled word alignments and phrase tables, bilingual dictionaries, frequency counts, and these files can be found through the <a href="/index.php">resources search form on the top-level website of OPUS</a>.</p><p><b>Copyright:</b> Please respect the <a href="https://www.ted.com/about/our-organization/our-policies-terms">TED Talks Usage Policy</a><br/></p>Note that this corpus is tokenized in its original form. For this package we applied automatic de-tokenization using the moses tools. This is not perfect and may miss some de-tokenization steps.<h3>Release history:</h3><p><ul><li><a href="NeuLab-TedTalks-v1.php">NeuLab-TedTalks v1</a></li></ul></p><table><tr><td>Bottom-left triangle: download files<ul><li><i>ces</i> = sentence alignments in XCES format</li> <li><i>leftmost column language IDs</i> = tokenized corpus files in XML</li> <li>TMX and plain text files (Moses): see "Statistics" below</li> <li><i>lower row language IDs</i> = parsed corpus files (if they exist)</li></ul></td><td>Upper-right triangle: sample files <ul><li><i>view</i> = bilingual XML file samples</li> <li><i>upper row language IDs</i> = monolingual XML file samples</li> <li><i>rightmost column language IDs</i> = untokenized corpus files</li></ul></td></tr></table><p><div class="sample"><table border="0" cellpadding="0">
